import React from 'react'
import { Contact } from '../models/contact.class'


export const ContactListComponent = () => {

    const deafultContact = new Contact('ContactName', 'ContactLastName', 'ContactEmail', true)

  return (
    <div>
        <h1>Contacts</h1>
        <Contact contact={ deafultContact }/>

    </div>
  )
}
